import React from 'react';
//import ContactForm from './Contact/ContactForm'
const ContactForm =()=>{
	

	return(
		<div className='col-12 row'>
		<div className='col-6 '>
			<h1>Keep In Touch</h1>
			<input placeholder="Name" />

			<div className="container">
				<button className="btn btn-primary">Primary Button</button>
			</div>
		</div>
		<div className='col-6'>
			<h1>Map</h1>
			<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d120637.9498959013!2d74.66027078853226!3d19.110466280604875!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bdcb05d46788921%3A0x6677e92c1a5181b6!2sAhmednagar%2C%20Maharashtra!5e0!3m2!1sen!2sin!4v1698549667702!5m2!1sen!2sin" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
		</div>
		</div>
	)

}
export default ContactForm;
